{% block title %}Owner index{% endblock %}

{% block body %}
    <h1>Owner index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>FirstName</th>
                <th>LastName</th>
                <th>Birthday</th>
                <th>Email</th>
                <th>Tel</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for owner in owners %}
            <tr>
                <td>{{ owner.id }}</td>
                <td>{{ owner.firstName }}</td>
                <td>{{ owner.lastName }}</td>
                <td>{{ owner.birthday ? owner.birthday|date('Y-m-d') : '' }}</td>
                <td>{{ owner.email }}</td>
                <td>{{ owner.tel }}</td>
                <td>
                    <a href=\"{{ path('owner_show', {'id': owner.id}) }}\">show</a>
                    <a href=\"{{ path('owner_edit', {'id': owner.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"7\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('owner_new') }}\">Create new</a>
{% endblock %}
